import React, { Component } from "react";
import { NavbarConsumer } from "./NavbarContext";

class Navbar extends Component{

    render(){
        return (
            <NavbarConsumer>
                {(navTarget) => {
                    return (
                        <ul>
                            {Object.keys(navTarget).map(
                                key => <li className="navbar-list" key={key}><a className="navbar-Link" href={navTarget[key].link}>{navTarget[key].item}</a></li>
                            )}
                        </ul>
                    );
                }}
            </NavbarConsumer>
        );
    }

}

export default Navbar;
